oxy_webhelp_navlinks = {"aws_prereq_exocompute-d22872e12044":{"topics":[{"title":"Network setup for Exocompute on AWS","shortdesc":"<p class=\"shortdesc\">To ensure the proper functioning of the Exocompute on AWS feature that uses the         Elastic Kubernetes Service (EKS) cluster, it is essential to meet specific network         prerequisites for seamless communication among <span class=\"ph\">RSC<\/span>, the EKS cluster, and AWS         services.<\/p>","href":"saas\/aws_network_setup_exocompute.html","attributes":{"data-id":"aws_network_setup_exocompute"},"menu":{"hasChildren":false},"tocID":"aws_network_setup_exocompute-d22872e12055","next":"aws_network_setup_exocompute-d22872e12055"},{"title":"Encryption key requirements for AWS centralized Exocompute","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> shares the snapshots of AWS workloads in the application account         with the centralized Exocompute host account for indexing or archiving. Before mapping an         application account to a centralized Exocompute host account, you are required to take         specific actions based on the encryption key used to encrypt snapshots.<\/p>","href":"saas\/aws_encryption_key_req_exocompute.html","attributes":{"data-id":"aws_encryption_key_req_exocompute"},"menu":{"hasChildren":false},"tocID":"aws_encryption_key_req_exocompute-d22872e12199","next":"aws_encryption_key_req_exocompute-d22872e12199"}]}};